import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <body>
      <nav class="navbar">
        <div class="col-sm-4 homelogo">
          <p> Home logo</p>
        </div>
      </nav>
      <div class="container">
        <h1 clas="teste">TESTE!</h1>
      </div>
    </body>
  );
}

export default Home;
